description.text:
It will not print very well due to the overhangs, but on the final version there will hopefully be overlap with the main body and possibly cheater bits to hold the wheels in place (I may make the center solid).
Parameter list and example command:<br />
//creates a simple tank tread carriage with the top lead drive wheel centered at 0,0,0<br />
//trackwidth - width of the track (ok, belt really I haven't figured out how to add plates easily)<br />
// tracklength - total length of the top span from front of lead driver to rear of tail driver<br />
// trackheight - height from bottom to top<br />
// trackthickness - track thickness, does not (currently) affect wheel offsets<br />
// lowerinset - how far the lower drivers are inset from the uppers<br />
// driverradius - radius of the drivers<br />
// driverthickness - thickness of the drivers<br />
// driverinset - driver inset from outside fo track<br />
// carriage(trackwidth, tracklength, trackheight, trackthickness, lowerinset, driveradius, drivethickness, driverinset)<br />
carriage(20, 80, 40, 2, 15, 10, 3, 2);
